point_ai:"AI",com_endpoint_anthropic_maxoutputtokens:"Maksimaalne märkide arv, mida vastuses genereerida saab. Lühemate vastuste jaoks määrake madalam väärtus ja pikemate vastuste jaoks kõrgem väärtus. Märkus: mudelid võivad peatuda enne selle maksimumi saavutamist.",com_endpoint_anthropic_prompt_cache:"Päringu vahemällu salvestamine võimaldab suurt konteksti või juhiseid API-kõnede vahel uuesti kasutada, vähendades kulusid ja latentsust",com_endpoint_anthropic_temp:"Vahemikus 0 kuni 1. Kasutage analüütiliste / valikvastustega küsimuste puhul väärtust, mis on lähemal 0-le, ning loominguliste ja genereerivate ülesannete puhul väärtust, mis on lähemal 1-le. Soovitame muuta kas seda või Top P-d, aga mitte mõlemat.",com_endpoint_anthropic_thinking:'Võimaldab sisemist mõtlemist toetatud Claude mudelite jaoks (3.7 Sonnet). Märkus: "Mõtlemiseelarve" peab olema määratud ja väiksem kui "Maksimaalsed väljundmärgid"',com_endpoint_anthropic_thinking_budget:'Määrab maksimaalse märkide arvu, mida Claude võib kasutada oma sisemise mõttekäigu jaoks. Suurem eelarve võib parandada vastuse kvaliteeti, võimaldades põhjalikumat analüüsi keerukate probleemide puhul. Claude ei pruugi kasutada kogu eraldatud eelarvet, eriti kui see ületab 32K. See seadistus peab olema väiksem kui "Maksimaalsed väljundmärgid".',com_endpoint_anthropic_topk:"Top-k muudab seda, kuidas mudel valib väljundi jaoks märgid. Top-k väärtus 1 tähendab, et valitud märk on kõige tõenäolisem kõigi mudeli sõnavaras olevate märkide seas (nimetatakse ka ahneks dekodeerimiseks), samas kui top-k väärtus 3 tähendab, et järgmine märk valitakse 3 kõige tõenäolisema märgi seast (kasutades temperatuuri).",com_endpoint_anthropic_topp:"Top-p muudab seda, kuidas mudel valib väljundi jaoks märgid. Märgid valitakse kõige tõenäolisemast K (vt parameetrit topK) kuni vähim tõenäoliseni, kuni nende tõenäosuste summa on võrdne top-p väärtusega.",com_endpoint_assistant:"Assistent",com_endpoint_assistant_model:"Assistendi mudel",com_endpoint_