com_nav_info_fork_split_target_setting:"هنگامی که فعال باشد، انشعاب از پیام هدف شروع می شود تا آخرین پیام در مکالمه، با توجه به رفتار انتخاب شده.",com_nav_info_include_shadcnui:"وقتی فعال باشد، دستورالعمل‌های استفاده از مؤلفه‌های shadcn/ui گنجانده می‌شود. shadcn/ui مجموعه‌ای از اجزای قابل استفاده مجدد است که با استفاده از Radix UI و Tailwind CSS ساخته شده‌اند. توجه: این دستورالعمل‌های طولانی هستند، فقط در صورتی باید آن را فعال کنید که اطلاع‌رسانی به LLM از واردات و اجزای صحیح برای شما مهم باشد. برای اطلاعات بیشتر در مورد این اجزاء به آدرس: https://ui.shadcn.com/ مراجعه کنید",com_nav_info_latex_parsing:"وقتی فعال باشد، کد LaTeX در پیام ها به صورت معادلات ریاضی ارائه می شود. اگر به رندر LaTeX نیاز ندارید، غیرفعال کردن این ممکن است عملکرد را بهبود بخشد.",com_nav_info_save_badges_state:"هنگامی که این گزینه فعال باشد، وضعیت نشان‌های چت ذخیره می‌شود. این بدان معناست که اگر یک چت جدید ایجاد کنید، نشان‌ها در همان وضعیت چت قبلی باقی خواهند ماند. اگر این گزینه را غیرفعال کنید، نشان‌ها در هر بار ایجاد یک چت جدید به حالت پیش‌فرض بازنشانی می‌شوند.",com_nav_info_save_draft:"وقتی فعال باشد، متن و پیوست‌هایی که در فرم چت وارد می‌کنید به‌طور خودکار به‌صورت محلی به‌عنوان پیش‌نویس ذخیره می‌شوند. این پیش‌نویس‌ها در دسترس خواهند بود حتی اگر صفحه را دوباره بارگیری کنید یا به مکالمه دیگری بروید. پیش نویس ها به صورت محلی در دستگاه شما ذخیره می شوند و پس از ارسال پیام حذف می شوند.",com_nav_info_show_thinking:"وقتی فعال باشد، چت به طور پیش‌فرض فهرست‌های بازشوی تفکر را نشان می‌دهد و به شما امکان می‌دهد استدلال هوش مصنوعی را در زمان واقعی مشاهده کنید. وقتی غیرفعال باشد، منوهای کشویی تفکر به طور پیش‌فرض بسته می‌مانند تا رابطی تمیزتر و کارآمدتر داشته باشند",com_nav_info_user_name_display:'وقتی فعال باشد، نام کاربری فرستنده بالای هر پیامی که ارسال می کنید نشان داده می شود. هنگامی که غیرفعال است، فقط "شما" را در بالای پیام های خود خواهید دید.',com_nav_lang_arabic:"العربية",com_nav_lang_auto:"تشخیص خودکار",com_nav_lang_brazilian_portuguese:"پرتغال برازیلیرو",com_nav_lang_chinese:"中文",com_nav_lang_d